最大音場パターン数は8192. 拡張モードの場合は16384 サンプリングレートは超音波周波数×512/Nで, Nは32-bit符号なし整数であり, 512以上の値である必要がある FociSTMの使用方法は以下のようになる. これは, アレイの中心から直上150mmの点を中心とした半径30mmの円周上で焦点を回すサンプルである. 円周上を200点サンプリングし, 一周を1Hzで回るようにしている. (すなわち, サンプリング周波数は200Hzである.) # use autd3::prelude::*;
# #[allow(unused_variables)]
# #[tokio::main]
# async fn main() -> Result<(), Box<dyn std::error::Error>> {
# let autd = Controller::builder([AUTD3::new(Vector3::zeros())]).open(autd3::link::Nop::builder()).await?;
let center = autd.geometry.center() + Vector3::new(0., 0., 150.0 * mm);
let point_num = 200;
let radius = 30.0 * mm;
let stm = FociSTM::from_freq( 1.0 * Hz, (0..point_num).map(|i| { let theta = 2.0 * PI * i as f32 / point_num as f32; let p = radius * Vector3::new(theta.cos(), theta.sin(), 0.0); center + p }),
)?;
# Ok(())
# } //~#include <ranges>
//~#include<autd3.hpp>
//~#include<autd3/link/nop.hpp>
//~using namespace std::ranges::views;
//~int main() {
//~auto autd =
//~autd3::ControllerBuilder({autd3::AUTD3(autd3::Vector3::Zero())}).open(autd3::link::Nop::builder());
const autd3::Vector3 center = autd.geometry().center() + autd3::Vector3(0, 0, 150);
const auto points_num = 200;
const auto radius = 30.0f;
auto stm = autd3::FociSTM<1>::from_freq( 1.0f * autd3::Hz, iota(0) | take(points_num) | transform([&](auto i) { const auto theta = 2.0f * autd3::pi * static_cast<float>(i) / static_cast<float>(points_num); autd3::Vector3 p = center + radius * autd3::Vector3(std::cos(theta), std::sin(theta), 0); return p; }));
//~return 0; } ~using AUTD3Sharp;
~using AUTD3Sharp.Utils;
~using AUTD3Sharp.Link;
~using static AUTD3Sharp.Units;
~using var autd = Controller.Builder([new AUTD3(Vector3.Zero)]).Open(Nop.Builder());
var center = autd.Geometry.Center + new Vector3(0, 0, 150);
const int pointNum = 200;
const float radius = 30.0f;
var stm = FociSTM.FromFreq(1.0f * Hz, Enumerable.Range(0, pointNum).Select(i =>
{ var theta = 2.0f * MathF.PI * i / pointNum; return center + radius * new Vector3(MathF.Cos(theta), MathF.Sin(theta), 0);
})); ~import numpy as np
~from pyautd3 import AUTD3, Controller, FociSTM, Hz
~from pyautd3.link.audit import Audit
~autd: Controller[Audit] = Controller.builder([AUTD3([0.0, 0.0, 0.0])]).open(
~ Audit.builder()
~)
center = autd.geometry.center + np.array([0.0, 0.0, 150.0])
point_num = 200
radius = 30.0
stm = FociSTM.from_freq( 1.0 * Hz, map( lambda theta: center + radius * np.array([np.cos(theta), np.sin(theta), 0]), map(lambda i: 2.0 * np.pi * i / point_num, range(point_num)), ),
) FociSTMのコンストラクタにはSTM周波数を指定する. なお, サンプリング点数とサンプリング周期に関する制約によって, 指定した周波数で出力できない可能性がある. 例えば, 上記の例は200点を1Hzで回すため, サンプリング周波数は200Hz=超音波周波数×512/102400とすれば良い. しかし, 例えばpoint_num=199にすると, サンプリング周波数を199Hzにしなければならないが, 超音波周波数が40kHzの場合, 199Hz=超音波周波数×512/Nを満たすような整数Nは存在せずエラーになる. from_freq_nearestを使用すると, 最も近いNが選択されるようになるが, 指定した周波数と実際の周波数がずれる可能性があるため注意が必要である.

