FociSTMの多焦点音場は単純な単焦点音場の重ね合わせである. すなわち, 振動子の位置xt​, 各焦点位置xi​, 超音波周波数f, 音速cに対して, 以下の計算により位相θを求めている. θ=∠i∑​e2πjcf​∥xi​−xt​∥+jϕi​ ここで, ϕi​は各焦点の位相オフセットである. 振幅に関しては, ​i∑​e2πjcf​∥xi​−xt​∥+jϕi​​ ではなく , ソフトウェアからの指定値を使用する. 各焦点の位相オフセットϕi​, 及び, 出力は以下のように指定する. # use autd3::prelude::*;
# #[allow(unused_variables)]
# #[tokio::main]
# async fn main() -> Result<(), Box<dyn std::error::Error>> {
# let autd = Controller::builder([AUTD3::new(Vector3::zeros())]).open(autd3::link::Nop::builder()).await?;
let center = autd.geometry.center() + Vector3::new(0., 0., 150.0 * mm);
