Fixed update rate modeにおける位相の変化 Silencerは位相Pの変化を線形補間し, 段階的にすることで静音化を行う. 即ち, 位相Pの時系列データを(単純)移動平均フィルタに通しているのにほとんど等しい. ただし, 位相データが周期的であるという事を考慮している点で異なる. 例えば, 超音波の周期TがT=12の場合を考える. 即ち, P=0が0rad, P=12が2πradに対応する. ここで, 時刻ts​で, 位相がP=2からP=6に変化したとする. この時, Silencerによる位相変化は以下の図のようになる. 位相Pの変化 一方, 時刻ts​で, 位相がP=2からP=10に変化したとする. この時のSilencerによる位相変化は以下の図のようになる. これは, P=10よりも, P=−2のほうが近いためである. 位相Pの変化 (位相変化量がπより大きい場合) つまり, Silencerは現在のPと目標値Pr​に対して P←{P+sign(Pr​−P)min(∣Pr​−P∣,Δ)P−sign(Pr​−P)min(∣Pr​−P∣,Δ)​if ∣Pr​−P∣≤T/2(otherwise)​, として位相Pを更新する. ここで, Δは1ステップ当たりの更新量 (Silencerのstep) を表す. なお, 更新周波数は超音波周波数となっている. Δが小さいほど, 位相変化はなだらかになり騒音が抑制される. Δによる変化の違い この実装の都合上, 移動平均フィルタとは異なる挙動を示す場合がある. 一つは, 上に示した位相変化量がπより大きい場合であり, もう一つが, 途中でもう一度位相が変化する場合である. この時の位相変化の例を以下に示す. 元時系列に対する忠実度という観点では移動平均フィルタが正しいが, 位相変化量がπより大きい場合を考慮したり, Δを可変にする (即ち, フィルタ長を可変にする) のが大変なため現在のような実装となっている. 移動平均フィルタとの比較 Fixed update rate modeにおける振幅の変化 振幅変動が騒音を引き起こすので, 振幅パラメータDも同等のフィルタをかけることでAMによる騒音を抑制できる. 振幅パラメータDは位相とは異なり周期的ではないので, 現在のDと目標値Dr​に対して D←D+sign(Dr​−D)min(∣Dr​−D∣,Δ), のように更新する. Fixed update rate modeの設定 Fixed update rate modeを設定するには, 以下のようにする. 引数はそれぞれ, 上述のΔに対応する. なお, 内部では, Silencerは 位相は8bitの値に256をかけたもの 振幅は変調データとかけ合わされたもの に対して適用される. # use autd3::prelude::*;
