NOTE: 同様の目的で, Custom を使用することもできる. ライブラリでは自前のGainを作成することができる. ここでは, Focusと同じように単一焦点を生成するFocalPointを実際に定義してみることにする. use autd3::prelude::*;
use autd3::derive::*; #[derive(Gain)]
pub struct FocalPoint { position: Vector3,
} impl FocalPoint { pub fn new(position: Vector3) -> Self { Self { position } }
} impl Gain for FocalPoint { fn calc(&self, _geometry: &Geometry) -> GainCalcResult { let position = self.position; Ok(Self::transform(move |dev| { let wavenumber = dev.wavenumber(); move |tr| { Drive::new( Phase::from((position - tr.position()).norm() * wavenumber * rad), EmitIntensity::MAX, ) } })) }
}
# #[allow(unused_variables)]
# fn main() { # } //~#include "autd3.hpp"
//~#include <unordered_map>
//~#include <limits>
class FocalPoint final : public autd3::derive::Gain<FocalPoint> { public: explicit FocalPoint(autd3::Vector3 point) : _point(std::move(point)) {} autd3::gain::GainCalcResult calc( const autd3::Geometry& geometry) const override { return transform([&](const auto& dev) { return [&](const auto& tr) { const auto phase = (tr.position() - _point).norm() * dev.wavelength(); return autd3::Drive{autd3::Phase(phase * autd3::rad), std::numeric_limits<autd3::EmitIntensity>::max()}; }; }); } private: autd3::Vector3 _point;
};
//~int main() { return 0; } ~using AUTD3Sharp;
~using AUTD3Sharp.Utils;
~using AUTD3Sharp.Gain;
~using static AUTD3Sharp.Units;
using AUTD3Sharp.Derive;
~var g = new FocalPoint(Vector3.Zero); [Gain]
public partial class FocalPoint
{ private readonly Vector3 _point; public FocalPoint(Vector3 point) { _point = point; } private Func<Device, Func<Transducer, Drive>> Calc(Geometry geometry) { return Transform(dev => tr => { var tp = tr.Position; var dist = (tp - _point).L2Norm; var phase = dist * dev.Wavenumber; return new Drive { Phase = new Phase(phase * rad), Intensity = EmitIntensity.Max }; }); }
} from collections.abc import Callable import numpy as np
from pyautd3 import Device, Drive, EmitIntensity, Geometry, Phase, Transducer, rad
from pyautd3.gain import Gain class Focus(Gain): def __init__(self, point): self.point = np.array(point) def calc(self, _: Geometry) -> Callable[[Device], Callable[[Transducer], Drive]]: return Gain._transform( lambda dev: lambda tr: Drive( Phase( float(np.linalg.norm(tr.position - self.point)) * dev.wavenumber * rad ), EmitIntensity.maximum(), ), ) send関数はGain型を継承したクラスを引数に取ることができる. そのため, Gain型を継承をしておく. send関数内部ではGeometryを引数にしたcalcメソッドが呼ばれる. calcの返り値は, Fn(&Device) -> Fn(&Transducer) -> Driveであり, この関数を元に振幅/位相データが送信される. Found a bug? Edit this page on GitHub.

