use autd3::derive::*; #[derive(Modulation)]
pub struct Burst { config: SamplingConfig, loop_behavior: LoopBehavior,
} impl Burst { pub fn new() -> Self { Self { config: SamplingConfig::Freq(4000 * Hz), loop_behavior: LoopBehavior::infinite(), } }
} impl Modulation for Burst { fn calc(&self) -> Result<Vec<u8>, AUTDInternalError> { Ok((0..4000) .map(|i| if i == 3999 { u8::MAX } else { u8::MIN }) .collect()) }
}
# #[allow(unused_variables)]
# fn main() { # } //~#include "autd3.hpp"
//~#include <vector>
//~#include <limits>
class BurstModulation final : public autd3::derive::Modulation<BurstModulation> { public: std::vector<uint8_t> calc() const override { std::vector buffer(_buf_size, std::numeric_limits<uint8_t>::min()); buffer[_buf_size - 1] = std::numeric_limits<uint8_t>::max(); return buffer; } explicit BurstModulation(const size_t buf_size = 4000) noexcept : Modulation(4000 * autd3::Hz), _buf_size(buf_size) {} private: size_t _buf_size;
};
//~int main() { return 0; } ~using AUTD3Sharp;
~using AUTD3Sharp.Utils;
~using AUTD3Sharp.Gain;
~using static AUTD3Sharp.Units;
using AUTD3Sharp.Derive;
~var m = new Burst(4000); [Modulation]
public partial class Burst
{ private readonly int _length; public Burst(int length) { _length = length; _config = 4000u * Hz; } private byte[] Calc() { var buf = Enumerable.Repeat<byte>(0x00, _length).ToArray(); buf[0] = 0xFF; return buf; }
} import numpy as np
from pyautd3 import EmitIntensity, Hz, SamplingConfig
from pyautd3.modulation import Modulation class Burst(Modulation): _length: int def __init__(self, length: int = 4000): super().__init__(SamplingConfig.Freq(4000 * Hz)) self._length = length def calc(self): buf = np.array([EmitIntensity.minimum()] * self._length) buf[0] = EmitIntensity.maximum() return buf ModulationもGainと同じく, send内部でcalcメソッドが呼ばれ, その返り値の変調データが使用される. したがって, このcalcの中で, 変調データを計算すれば良い. SDKにはない. Found a bug? Edit this page on GitHub.

