PWM信号のDuty比と超音波出力の間には非線形な関係がある. この関係を補正するために, PulseWidthEncoderを使用できる. ファームウェア内部には, Gain/FociSTM/GainSTMの振幅データ (0--255) とModulationの振幅データ (0--255) をかけ合わせた強度データを2で割ったもの (0--32512) をインデックスにして, PWM信号のパルス幅 (0--256) を決定するテーブルがある. PulseWidthEncoderによってこのテーブルを変更できる. # use autd3::prelude::*;
# #[allow(unused_variables)]
# #[tokio::main]
