まず, ターミナルを開き, 適当なプロジェクトを作成し, AUTD3Sharpライブラリを追加する. dotnet new console --name autd3-sample
cd autd3-sample
dotnet add package AUTD3Sharp 次に, Program.csを以下のようにする. これは単一焦点に150HzのAM変調をかける場合のソースコードである. using AUTD3Sharp;
using AUTD3Sharp.Utils;
using AUTD3Sharp.Link;
using AUTD3Sharp.Gain;
using AUTD3Sharp.Modulation;
using static AUTD3Sharp.Units; using var autd = Controller.Builder([new AUTD3(Vector3.Zero)]) .Open(SOEM.Builder().WithErrHandler((slave, status, msg) => { switch (status) { case Status.Error: Console.Error.WriteLine($"Error [{slave}]: {msg}"); break; case Status.Lost: Console.Error.WriteLine($"Lost [{slave}]: {msg}"); // You can also wait for the link to recover, without exiting the process Environment.Exit(-1); break; case Status.StateChanged: Console.Error.WriteLine($"StateChanged [{slave}]: {msg}"); break; }; })); var firmList = autd.FirmwareVersion();
foreach (var firm in firmList) Console.WriteLine(firm); autd.Send(Silencer.Default()); var g = new Focus(autd.Geometry.Center + new Vector3(0, 0, 150));
var m = new Sine(150u * Hz);
autd.Send((m, g)); Console.ReadKey(true); autd.Close(); そして, これを実行する. dotnet run -c:Release

