from pyautd3.link.soem import SOEM, Status, TimerStrategy def err_handler(slave: int, status: Status, msg: str) -> None: match status: case Status.Error: print(f"Error [{slave}]: {msg}") case Status.Lost: print(f"Lost [{slave}]: {msg}") # You can also wait for the link to recover, without exiting the process os._exit(-1) case Status.StateChanged: print(f"StateChanged [{slave}]: {msg}") SOEM.builder()\ .with_ifname("")\ .with_buf_size(32)\ .with_err_handler( err_handler )\ .with_state_check_interval(timedelta(milliseconds=100))\ .with_sync0_cycle(2)\ .with_send_cycle(2)\ .with_timer_strategy(TimerStrategy.BusyWait)\ .with_sync_tolerance(timedelta(microseconds=1))\ .with_sync_timeout(timedelta(seconds=10)) ifname: ネットワークインタフェース名. デフォルトでは空白であり, 空白の場合はAUTD3デバイスが接続されているネットワークインタフェースを自動的に選択する. buf_size: 送信キューバッファサイズ. 通常は変更する必要はない. err_handler: 何らかのエラーが発生したときのコールバック. コールバック関数はエラーが発生したデバイスインデックス, エラーの種類を引数に取る. state_check_interval: エラーが出ているかどうかを確認する間隔. デフォルトは100ms. sync0_cycle: 同期信号の周期. デフォルトは2 (単位は500us). send_cycle: 送信サイクル. デフォルトは2 (単位は500us). SOEMも大量のデバイスを接続すると挙動が不安定になる場合がある [1] . このときは, sync0_cycleとsend_cycleの値を増やす. これら値はエラーが出ない中で, 可能な限り小さな値が望ましい. デフォルトは2であり, どの程度の値にすべきかは接続している台数に依存する. 例えば, 9台の場合は3, 4程度の値にしておけば動作するはずである. timer_strategy: タイマーの戦略. デフォルトはSleepである. Sleep : 標準ライブラリのsleepを用いる BusyWait : ビジーウェイトを用いる. 高解像度だが, CPU負荷が高い. NativeTimer : OSのタイマー機能を用いる WindowsではTimerQueueTimer, linuxではPOSIXタイマー, macOSではGrand Central Dispatch Timer sync_tolerance: 同期許容レベル. 初期化時, 各デバイスのシステム時間差がこの値以下になるまで待機する. 以下のタイムアウト時間が経過しても同期が完了しない場合はエラーとなる. デフォルトは1usであり, 変えることは推奨されない. sync_timeout: 同期タイムアウト. 上記のシステム時間差測定のタイムアウト時間. デフォルトは10s.

