Holoは多焦点を生成するためのGainである. 多焦点を生成するアルゴリズムが幾つか提案されており, SDKには以下のアルゴリズムが実装されている. SDP - Semidefinite programming, 井上らの論文 [1] に基づく Naive - 単一焦点解の重ね合わせ GS - Gershberg-Saxon, Marzoらの論文 [2] に基づく GSPAT - Gershberg-Saxon for Phased Arrays of Transducers, Plasenciaらの論文 [3] に基づく LM - Levenberg-Marquardt, LM法はLevenberg [4] とMarquardt [5] で提案された非線形最小二乗問題の最適化法, 実装はMadsenのテキスト [6] に基づく. Greedy - Greedy algorithm and Brute-force search, 鈴木らの論文 [7] に基づく また, 各手法は計算Backendを選べるようになっている. SDKには以下のBackendが用意されている NalgebraBackend - Nalgebra を使用 CUDABackend - CUDAを使用, GPUで実行 ArrayFireBackend - ArrayFire を使用 (Rust版のみ使用可能) NOTE: CUDABackendやArrayFireBackendは高速化を目的としているが, ほとんどの場合, NalgebraBackendで十分である. 使用時は, 必ずベンチマークを取ること. # use autd3::prelude::*;
